con:configuration.scriptText:
//extract the webservice response
import groovy.util.XmlSlurper
def cdata=context.expand('${AirportCode - Request 1#Response#declare namespace ns1=\'http://www.webserviceX.NET\'//ns1:getAirportInformationByAirportCodeResponse/ns1:getAirportInformationByAirportCodeResult/text()}')
log.info cdata
//read the airport code and assert the value

XmlSlurper xmlSlurper= new XmlSlurper()
def xmlData=xmlSlurper.parseText(cdata)
String airportCode=xmlData.Table[0].AirportCode
assert airportCode == 'LHR'
